import { BrowserRouter, Route, Routes } from "react-router-dom";
import Mainpage from './pages/ㅡainpage';

function App() {

  return (
  <>
    <BrowserRouter>
    <Routes>
      <Route exact path="/" element={<Mainpage/>} />
    </Routes>
    </BrowserRouter>
  </>
  );
}

export default App;
